css:
@-moz-document url-prefix("https://wiby.me/") {
/*theme for wiby.me by Desu*/
body {
	background: #2b2929;
    color: #9e938e;
}
p.titlep, a.tiny, a:link, font[color="#7900A7"], .pin {
	color: #ccc5c3;  
}
.url {
    color: #9e6bbf;
}
input[type="text"], input[type="submit"] {
	border: 1px solid #222;
    background: #444;
    padding: 5px;
    color: #9e938e;
}
p.titlep {
    padding-bottom: 140px;
    /*begin base64 encoded image string*/
    background:  url('data:image/gif;base64,') center bottom no-repeat;
}
}
